import React from 'react'
import './App.css'

const About = () => {
    return(
        <div className="App">
            <h1>About</h1>
            <h2>'Angels among us' is a simple tool for people looking for ways to share some of their income with people who are in dire economic straits because of the COVID-19 pandemic.</h2>
        </div>
    )
}

export default About
